import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css'
const Tab = (props) => {
  const handleClick = (idx) => {
    setContent(`Tab ${idx} content is showing here`)
  }
  return (
    <div>
      <h3
        className="btn btn-outline-dark"
        onClick={handleClick(props.idx)}
      >
        Tab {props.idx}
      </h3>
    </div>
  )
}

export default Tab
